import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import inventory from './inventory.ES6';

class CheckBox extends Component {


    render() {
        return (
            <form
            //className="was-validated"
            //id={this.props.id}
            >
                {Object.keys(inventory).filter(name => inventory[name][this.props.property]).map(name =>
                    <div className="form-check"
                        key={name} className="form-check form-check-inline col-md-3">
                        <input
                            checked={this.props.list[name] || false}
                            className="form-check-input"
                            type="checkbox"
                            value={this.props.property}
                            name={name}
                            onChange={this.props.handleSelect}
                            //required
                        />

                        <label className="form-check-label"  >
                            <Link className="nav-link" to={"/view-ingredient/" + name}>
                                {name}
                            </Link>
                        </label>
                        <div className="valid-feedback"> </div>
                        <div className="invalid-feedback"> Välj åtminstonde en </div>
                    </div>
                )}


            </form>

        );
    }
}
export default CheckBox;
